import React, { Component } from "react";

export default class Projects extends Component {
  componentDidMount() {
    axios
      .get("https://www.portfolioabby.com/wp-json/wp/v2/posts?per_page=100")
      .then((res) =>
        this.setState({
          posts: res.data,
          isLoaded: true,
        })
      )
      .catch((err) => console.log(err));
  }

  render() {
    return <div>projects</div>;
  }
}
